import classes from './Assignmentform.module.css';


const Assignmentform=()=>{

    return (
    <div className={classes.assignmentFormDiv}>
      <form></form>

     <div>Assignment Title</div>
       <input type="text"/>

       <div>
      Assignment Assign By</div>
       <input type="text"/>


      <div>Start Date</div>
       <input type="text"/>

      <div>Due Date</div>
       <input type="text"/>

      <div>Total Credit</div>
       <input type="text"/>

      <div>Descriptions</div>
       <input type="text"/>

       <div>Questions</div>
       <input type="text"/>







    </div>
    );



};

export default Assignmentform;
